const dotenv = require("dotenv").config();

export const testConnectDB = async () => {

    mongoose.set('strictQuery', true);

    mongoose.connect(process.env.DATABASE_URI, {
        useNewUrlParser: true
    })

    console.log(mongoose.Collection)
}

