import express from 'express'
const router = express.Router();
import { columValidation } from '../../validations/colum.validation';
import { columController } from '../../controllers/colum.controller';

router
    .route("/")
    .get((req, res) => { console.log("get colum") })
    .post(columValidation.createNew, columController.createNew);

export const columRouter = router;

